      }
    }


    if ($this->isModified() && !$this->isColumnModified(EnrollmentPeer::UPDATED_AT))
    {
      $this->setUpdatedAt(time());
    }

    if ($this->isNew() && !$this->isColumnModified(EnrollmentPeer::CREATED_AT))
    {
      $this->setCreatedAt(time());
